import React from 'react';
import styled, { css } from 'styled-components';
import bingoSound from './bingo.mp3';

interface BuzzwordCellProps {
    value: string;
    ismarked: boolean;
    ishighlighted: boolean;
    onClick?: () => void;
    style?: React.CSSProperties; // Add the style property to the interface
}

const CellContainer = styled.div<{ ismarked: boolean; ishighlighted: boolean }>`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: ${(props) => (props.ismarked ? '#9fd8cb' : '#f2f2f2')};
  color: ${(props) => (props.ismarked ? '#ffffff' : '#000000')};
  font-weight: bold;
  font-size: 16px;
  width: 130px;
  height: 130px;
  cursor: pointer;
  border: 1px solid #000;

  ${(props) =>
        props.ishighlighted &&
        css`
      background-color: #000000;
    `}

    ${({ isBingo }) =>
    isBingo &&
    css`
      // Apply styling for Bingo cells
      background-color: yellow;
      // ...other styles for Bingo cells...
    `}
`;

const BuzzwordCell: React.FC<BuzzwordCellProps> = ({
    value,
    ismarked,
    ishighlighted,
    onClick,
}) => {
    return (
        <CellContainer
            ismarked={ismarked}
            ishighlighted={ishighlighted}
            onClick={onClick}
        >
            {value}
        </CellContainer>
    );
};

export default BuzzwordCell;
